-- Tables

CREATE TABLE User (
	username varchar(100) NOT NULL,
    password varchar(60) NOT NULL,
    first_name varchar(100) NOT NULL,
	last_name varchar(100) NOT NULL,
	date_started date NOT NULL,
	email_address varchar(250) NULL,
	PRIMARY KEY (username)
);

CREATE TABLE Employee (
	username varchar(100) NOT NULL,
	PRIMARY KEY (username),
    FOREIGN KEY (username) REFERENCES User (username)
);

CREATE TABLE Owner (
	username varchar(100) NOT NULL,
	PRIMARY KEY (username),
    FOREIGN KEY (username) REFERENCES User (username)
);


CREATE TABLE Volunteer (
	username varchar(100) NOT NULL,
	phone_number varchar(60) NOT NULL,
	PRIMARY KEY (username),
    FOREIGN KEY (username) REFERENCES User (username)
);

CREATE TABLE Volunteer_work (
    username varchar(100) NOT NULL,
    work_date date NOT NULL,
	work_hours decimal(16) NOT NULL,
	PRIMARY KEY (username, work_date),
    FOREIGN KEY (username) REFERENCES Volunteer (username)
);


CREATE TABLE Species (
	species_name varchar(100) NOT NULL,
	number_limit int(16) NOT NULL,
	PRIMARY KEY (species_name)
);

CREATE TABLE Animal (
	pet_ID varchar(16) NOT NULL,
	name varchar(100) NOT NULL,
	sex varchar(10) NOT NULL,
	alteration_status varchar(100) NOT NULL,
/*born_date date NOT NULL,*/
	age_months int(16) not null,
	description varchar(1000) NOT NULL,
	microchip_ID varchar(100) NULL,
	surrender_reason varchar(1000) NOT NULL,
	surrender_date date NOT NULL,
	surrender_by_animal_control varchar(10) NOT NULL,
	user_entered_surrender_info varchar(100) NOT NULL,
	species_name varchar(100) NOT NULL,
	PRIMARY KEY (pet_ID),
    FOREIGN KEY (species_name) REFERENCES Species (species_name),
    FOREIGN KEY (user_entered_surrender_info) REFERENCES Employee (username)
);

CREATE TABLE EnterUpdate (
	username varchar(100) NOT NULL,
    pet_ID varchar(16) NOT NULL,
    PRIMARY KEY (username, pet_ID),
    FOREIGN KEY (username) REFERENCES User (username),
    FOREIGN KEY (pet_ID) REFERENCES Animal (pet_ID)
);

CREATE TABLE Adoption_Applicant(
    email_address varchar(250) NOT NULL,
    applicant_first_name varchar(100) NOT NULL,
	applicant_last_name varchar(100) NOT NULL,
	zip_code varchar(16) NOT NULL,
	city varchar(100) NOT NULL,
	street varchar(100) NOT NULL,
	state varchar(100) NOT NULL,
	phone_number varchar(60) NOT NULL,
   /*    username varchar(100) NOT NULL,*/
	PRIMARY KEY (email_address)
/*    FOREIGN KEY (username) REFERENCES User (username)*/
);

CREATE TABLE Adoption_Application (
	application_ID int(16) NOT NULL AUTO_INCREMENT,
	co_applicant_first_name varchar(100) NULL,
	co_applicant_last_name varchar(100) NULL,
	date_of_application date NOT NULL,
	application_state varchar(20) NOT NULL,
    email_address varchar(250) NOT NULL,
    PRIMARY KEY (application_ID),
	FOREIGN KEY (email_address) REFERENCES Adoption_Applicant (email_address)
);

CREATE TABLE Adopt (
	pet_ID varchar(16) NOT NULL,
	application_ID int(16) NOT NULL,
	adoption_fee decimal(16,2) NOT NULL,
	adoption_date date NOT NULL,
	FOREIGN KEY (pet_ID) REFERENCES Animal (pet_ID),
	FOREIGN KEY (application_ID) REFERENCES Adoption_Application (application_ID)
);

CREATE TABLE EnterUpdateApproveReject (
	username varchar(100) NOT NULL,
    application_ID int(16) NOT NULL AUTO_INCREMENT,
    PRIMARY KEY (username, application_ID),
    FOREIGN KEY (username) REFERENCES User (username),
    FOREIGN KEY (application_ID) REFERENCES Adoption_Application (application_ID)
    
);
