CREATE TABLE Breed (
    breed_name VARCHAR(100) NOT NULL,
    species_name VARCHAR(16) NOT NULL,
    PRIMARY KEY (breed_name, species_name),
    foreign key (species_name) references Species (species_name)
);

CREATE TABLE AssignChoose (
    pet_ID VARCHAR(16) NOT NULL,
    breed_name VARCHAR(100) NOT NULL,
    PRIMARY KEY (pet_ID , breed_name),
    FOREIGN KEY (pet_ID)
        REFERENCES Animal (pet_ID),
    FOREIGN KEY (breed_name)
        REFERENCES Breed (breed_name)
);


CREATE TABLE Vaccination_Type (
	vaccination_type_name varchar(100) NOT NULL,
    PRIMARY KEY (vaccination_type_name)
);

CREATE TABLE Vaccination (
	pet_ID varchar(16) NOT NULL,
	vaccination_type_name varchar(100) NOT NULL,
	date_administered date NOT NULL,
	expiration_date date NOT NULL,
	vaccination_number varchar(16) NULL,
	username varchar(100) NOT NULL,
    PRIMARY KEY (pet_ID, vaccination_type_name, date_administered),
	FOREIGN KEY (pet_ID) REFERENCES Animal (pet_ID),
	FOREIGN KEY (vaccination_type_name) REFERENCES Vaccination_Type (vaccination_type_name),
    FOREIGN KEY (username) REFERENCES User (username)
);

CREATE TABLE Require_Or_Not (
	species_name varchar(100) NOT NULL,
	vaccination_type_name varchar(100) NOT NULL,
	required_for_adoption varchar(10) NOT NULL,
    PRIMARY KEY (species_name, vaccination_type_name),
	FOREIGN KEY (species_name) REFERENCES Species (species_name),
	FOREIGN KEY (vaccination_type_name) REFERENCES Vaccination_Type (vaccination_type_name)
);


























